import React, {useState} from 'react'; 


//Import Components
import Header from './components/Header';
import Current from './components/Current';


function App() {
  let [zipCode, setZipCode] = useState(null); 

  if (zipCode === 5 && zipCode === /^[0-9]+$/) {
    return (
      <React.Fragment>
        <Header />
        <Current zipCode={zipCode} />
      </React.Fragment>
    )  
  } else {
    return (
      <div className="zipCode">
        <h3>Zipcode: <input 
          id="zipCode" 
          name="zipCode" 
          type="text" 
          value={zipCode}
          onChange={(e) => setZipCode(e.target.value)} /></h3>  
      </div>
    )
  }


}

export default App;
